import React, { useState } from "react";

export default function UserLoguin() {
  const initialState = { email: "", password: "" };
  const [loguin, setLoguin] = useState(initialState);

  const handleInput = (e) => {
    const name = e.target.name;
    const value = e.target.value;

    setLoguin({ ...loguin, name: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(loguin);
  };
  return (
    <>
      <div className="container">
        <div className="form-loguin">
          <form className="logueando">
            <div className="bienvenida">Welcome, Please Sing Up</div>
            <br></br>
            <label htmlFor="email">Email</label>
            <input
              type="text"
              id="email"
              name="email"
              input={loguin.email}
              onChange={handleInput}
              required
            />
            <label htmlFor="pass">Password</label>
            <input
              type="password"
              id="pass"
              name="password"
              input={loguin.password}
              onChange={handleInput}
              required
            />
            <div className="bottons form-bottons">
              <button>Ingresa</button>
              <button className="form-bottons">Registrate</button>
            </div>
          </form>
        </div>
      </div>
    </>
  );
}
